script: |
  super -f text -I q3565.spq | sort > q3565.out

inputs:
  - name: q3565.spq
    data: |
      SELECT DISTINCT + col0 * col1 + - + col0 * col0 / 20 + + CAST ( - 10 AS INTEGER ) FROM tab2 (FORMAT parquet) WHERE + col1 / 49 BETWEEN col2 AND - + 12;
  - name: tab2

outputs:
  - name: q3565.out
    data: |
